import Link from 'next/link';
import MasterPage from '../components/Master';
import fetch from 'isomorphic-unfetch';

const index = (props) =>{
    return(
        <MasterPage>
            <div className="row">               
                <div className="col-12">
                    <h2>Bitcoin</h2>
                    {console.log(props)}
                </div>

                <div className="col-md-8">
                    <h2>Noticias</h2>
                </div>

                <div className="col-md-4">
                    <h2>Destacados</h2>                    
                </div>


            </div>
        </MasterPage>
    )
}

// al cargarse el componenete se ejecuta esta funcion y guarda
// los resultados como props
index.getInicialProps = async () =>{
    const precio = await fetch(`https://min-api.cryptocompare.com/data/price?fsym=BTC&tsyms=USD`);
    const rst = await precio.json();
    return {
        precioBitcoin : rst.data
    }}

export default index;
